/* eslint no-unused-vars: 0 */
import { html, svg, repeat, classMap, styleMap, ifDefined, unsafeHTML, scopeTag } from "@ui5/webcomponents-base/dist/renderer/LitRenderer.js";

const block0 = (context, tags, suffix) => html`<div class="ui5-media-gallery-root" dir=${ifDefined(context.effectiveDir)}><div class="ui5-media-gallery-display-wrapper"><div class="ui5-media-gallery-display" @click="${context._onDisplayAreaClick}">${ context._isPhonePlatform ? block1(context, tags, suffix) : block3(context, tags, suffix) }</div></div>${ context._showThumbnails ? block4(context, tags, suffix) : undefined }</div>`;
const block1 = (context, tags, suffix) => html`<${scopeTag("ui5-carousel", tags, suffix)} @ui5-navigate="${ifDefined(context._onCarouselNavigate)}" hide-navigation-arrows>${ repeat(context._selectableItems, (item, index) => item._id || index, (item, index) => block2(item, index, context, tags, suffix)) }</${scopeTag("ui5-carousel", tags, suffix)}>`;
const block2 = (item, index, context, tags, suffix) => html`<slot name="${ifDefined(item._individualSlot)}"></slot>`;
const block3 = (context, tags, suffix) => html`<${scopeTag("ui5-media-gallery-item", tags, suffix)} ?_interactive="${ifDefined(context.interactiveDisplayArea)}" ?_square="${ifDefined(context._shouldHaveSquareDisplay)}" _tab-index="${ifDefined(context._mainItemTabIndex)}"></${scopeTag("ui5-media-gallery-item", tags, suffix)}>`;
const block4 = (context, tags, suffix) => html`<div class="ui5-media-gallery-thumbnails-wrapper"><ul>${ repeat(context._visibleItems, (item, index) => item._id || index, (item, index) => block5(item, index, context, tags, suffix)) }${ context._showOverflowBtn ? block6(context, tags, suffix) : undefined }</ul></div>`;
const block5 = (item, index, context, tags, suffix) => html`<li id="${ifDefined(item.id)}" class="ui5-media-gallery-thumbnail" role="option" @click="${context._onThumbnailClick}" @ui5-click="${ifDefined(context._onThumbnailClick)}"><slot name="${ifDefined(item._individualSlot)}"></slot></li>`;
const block6 = (context, tags, suffix) => html`<li class="ui5-media-gallery-overflow"><${scopeTag("ui5-button", tags, suffix)} @click="${context._onOverflowBtnClick}">+${ifDefined(context._overflowSize)}</${scopeTag("ui5-button", tags, suffix)}></li>`;


export default block0;
